import React, { Component } from "react";
import '../../App.css';
import Drawer from '@material-ui/core/Drawer';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import * as videoStyles from  "../../styles/video";
import * as drawerStyles from "../../styles/drawer";
import {button} from "../../styles/button";


class Home extends Component {

    constructor(props){
        super(props);       
    }
 
  


    render() {
             
        return (
        <>
        <Drawer style={drawerStyles.drawer} variant="permanent" anchor="left">
        <div>Surveillance</div>
        <Divider />
          <List>
          {['Live Surviellance', 'Surveillance History', 'Daily Summary', 'Threat Analytics'].map((text, index) => (
            <ListItem style={button} button key={text}>
             {/*  <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}

         </List>
        </Drawer>    
        <div style={videoStyles.videoContainer} >
           <iframe style={videoStyles.video} width="700" height="400" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe>
        </div>
        </> 

        );
    }
}



export default Home;
